SOLVER = './target/profiling/solver'
INSTANCE_GEN = './target/profiling/instance_gen'
DELETE = False

def run_instance(file, aux_memory_usage, aux_time, aux_expanded, aux_opened):
    t = time.monotonic_ns()
    ret = subprocess.run([
        "heaptrack",
        '-o', f"{file}.heaptrack",
        SOLVER,
        '-c', f"{file}"
    ], capture_output=True)
    duration = time.monotonic_ns() - t
    data = subprocess.run(['heaptrack_print', f"{file}.heaptrack.zst"], capture_output=True)
    mem = re.search(r'peak heap memory consumption: ([0-9\\.]+)([KMG]?)', data.stdout.decode().split('\n')[-4])
    used_memory = float(mem.groups()[0]) * (1024 if mem.groups()[1] == 'K' else 1024*1024 if mem.groups()[1] == 'M' else 1024*1024*1024 if mem.groups()[1] == 'G' else 1)
    res = yaml.safe_load("\n".join(ret.stdout.decode().split('\n')[3:-3]))

    try:
        aux_memory_usage[-1].append(used_memory)
        aux_time[-1].append(duration)
        aux_expanded[-1].append(res['expanded_states'])
        aux_opened[-1].append(res['opened_states'])
    except:
        print(ret.stdout.decode(), ret.stderr.decode())


def gen_instance(sigma, i):
    instance = {
        "id": f"alternative_methods_eval_sigma_{sigma}_{i}",
        "kind": "settings",
        "seed": i*69420,
        "greedy": True,
        "obstacles": math.floor(100*100*0.1),
        "time_max": 100*4,
        "size": {
            "width": 100,
            "height": 100
        },
        "agents": {"number": math.floor((100*100*0.9)*sigma), "stop_probability": 0.001},
        "noise": {
            "cell_size": 5,
            "offset": 0.1
        }
    }
    with open(f"tests/solver/alternative_methods_eval_sigma/noaux/alternative_methods_eval_{sigma}_{i}.yaml", 'w') as out:
        out.write(yaml.dump(instance))
    o = subprocess.run([
        INSTANCE_GEN,
        '-c', f"tests/solver/alternative_methods_eval_sigma/noaux/alternative_methods_eval_{sigma}_{i}.yaml"
    ], capture_output=True)
    with open(f"tests/solver/alternative_methods_eval_sigma/noaux/alternative_methods_eval_{sigma}_{i}_instance.yaml", 'w') as out:
        out.write(o.stdout.decode())

    instance['id'] = f"alternative_methods_eval_sigma_aux_{sigma}_{i}_aux"
    instance['aux_path'] = f"tests/solver/alternative_methods_eval_sigma/aux/alternative_methods_eval_{sigma}_{i}.aux"
    with open(f"tests/solver/alternative_methods_eval_sigma/aux/alternative_methods_eval_{sigma}_{i}_aux.yaml", 'w') as out:
        out.write(yaml.dump(instance))
    o = subprocess.run([
        INSTANCE_GEN,
        '-c', f"tests/solver/alternative_methods_eval_sigma/aux/alternative_methods_eval_{sigma}_{i}_aux.yaml"
    ], capture_output=True)
    with open(f"tests/solver/alternative_methods_eval_sigma/aux/alternative_methods_eval_{sigma}_{i}_aux_instance.yaml", 'w') as out:
        out.write(o.stdout.decode())


def solve_run(sigma, i):
    no_aux_instance_file = f"tests/solver/alternative_methods_eval_sigma/noaux/alternative_methods_eval_{sigma}_{i}_instance.yaml"
    aux_instance_file = f"tests/solver/alternative_methods_eval_sigma/aux/alternative_methods_eval_{sigma}_{i}_aux_instance.yaml"

    t = [
        threading.Thread(target=run_instance, args=(no_aux_instance_file, no_aux_memory_usage, no_aux_time, no_aux_expanded, no_aux_opened)),
        threading.Thread(target=run_instance, args=(aux_instance_file, aux_memory_usage, aux_time, aux_expanded, aux_opened))
    ]

    for tt in t:
        tt.start()
    for tt in t:
        tt.join()

    if DELETE:
        os.unlink(no_aux_instance_file)
        os.unlink(aux_instance_file)
        os.unlink(f"{no_aux_instance_file}.heaptrack.zst")
        os.unlink(f"{aux_instance_file}.heaptrack.zst")
        os.unlink(f"tests/solver/alternative_methods_eval_sigma/noaux/alternative_methods_eval_{sigma}_{i}.yaml")
        os.unlink(f"tests/solver/alternative_methods_eval_sigma/aux/alternative_methods_eval_{sigma}_{i}_aux.yaml")
        os.unlink(f"tests/solver/alternative_methods_eval_sigma/aux/alternative_methods_eval_{sigma}_{i}.aux")


def r(sigma, i):
    gen_instance(sigma, i)
    solve_run(sigma, i)

